import { Link } from 'react-router-dom'
import './DropDown.scss'

const DropDown = () => {
	const formatTitle = (title) => {
    return title.replace(/_/g, ' ');
  };
	return (
		<div className='dropdown'>
			<ul>
				<li><Link to="/category/1">{formatTitle(Наушники)}</Link></li>
				<li><Link to="/category/2">Home</Link></li>
				<li><Link to="/category/3">Home</Link></li>
				<li><Link to="/category/4">Home</Link></li>
			</ul>
		</div>
	)
}

export default DropDown
